INSERT INTO [dbo].[Posts] ([Id], [Title], [Body], [User_Id], [Time]) VALUES (1, N'This is my First Post', N'Hello, Very nice to meet you guys here, would be happy to share some of my thoughts!',N'079db823-d899-4805-a448-6019fee01211',N'2018-08-20 11:35:25')
INSERT INTO [dbo].[Posts] ([Id], [Title], [Body], [User_Id], [Time]) VALUES (2, N'This is my Second Post', N'Reporting to Systems Development Manager, this exciting role will work with other developers, solutions architects, solutions designers and Business Intelligence Analysts as well as other team members within Information Services (IS). ',N'079db823-d899-4805-a448-6019fee01211',N'2018-08-21 11:35:25')
INSERT INTO [dbo].[Posts] ([Id], [Title], [Body], [User_Id], [Time]) VALUES (3, N'This is my Thrid Post', N'Food variety means eating a wide variety of foods from each of the five food groups, in the amounts recommended. Eating many different foods helps maintain a healthy and interesting diet which provides a range of different nutrients to the body. Eating a variety of foods promotes good health and can help reduce the risk of disease.',N'5337eb88-a45e-4e22-b2bc-306dd8c7500f',N'2018-08-22 11:35:25')
INSERT INTO [dbo].[Posts] ([Id], [Title], [Body], [User_Id], [Time]) VALUES (4, N'Hello WOW', N'Foods are grouped together because they provide similar amounts of key nutrients. For example, key nutrients of the milk, yoghurt, cheese and alternatives group include calcium and protein, while the fruit group is a good source of vitamins, especially vitamin C. These food groups make up the Australian Guide to Healthy Eating',N'3be0b601-5487-4a8f-a3ea-8c6d7be87e10',N'2018-08-23 11:35:25')
INSERT INTO [dbo].[Posts] ([Id], [Title], [Body], [User_Id], [Time]) VALUES (5, N'Microbiome Rules!', N'Vegetables and legumes 每 raw or cooked vegetables can be used as a snack food or as a part of lunch and dinner. Salad vegetables can be used as a sandwich filling. Vegetable soup can make a healthy lunch. Stir-fries, vegetable patties and vegetable curries make nutritious evening meals. Try raw vegetables like carrot and celery sticks for a snack ＆on the run＊.',N'079db823-d899-4805-a448-6019fee01211',N'2018-08-27 21:45:22')
INSERT INTO [dbo].[Posts] ([Id], [Title], [Body], [User_Id], [Time]) VALUES (6, N'Get on Diet', N'Fruit 每 this is easy to carry as a snack and can be included in most meals. For example, try a banana with your breakfast cereal, an apple for morning tea and add some berries in your yoghurt for an afternoon snack. Fresh whole fruit is recommended over fruit juice and dried fruit. Fruit juice contains less fibre than fresh fruit and both fruit juice and dried fruit, and are more concentrated sources of sugar and energy. Dried fruit can also stick to teeth, which can increase the risk of dental caries.',N'3be0b601-5487-4a8f-a3ea-8c6d7be87e10',N'2018-08-23 15:35:25')
INSERT INTO [dbo].[Posts] ([Id], [Title], [Body], [User_Id], [Time]) VALUES (7, N'Eat Some bacterial help you loose weight', N'Bread, cereals, rice, pasta and noodles 每 add rice, pasta or noodles to serves of protein and vegetables for an all-round meal. There are many varieties of these to try. Where possible, try to use wholegrains in breads and cereals.',N'5337eb88-a45e-4e22-b2bc-306dd8c7500f',N'2018-08-29 18:35:25')
INSERT INTO [dbo].[Posts] ([Id], [Title], [Body], [User_Id], [Time]) VALUES (8, N'No Kdding, Read This', N'Lean meat, fish, poultry, eggs, nuts, legumes and tofu 每 these can all provide protein. It＊s easy to include a mixture of protein into snacks and meals. Try adding lean meat to your sandwich or have a handful of nuts as a snack. You can also add legumes to soups or stews for an evening meal.',N'079db823-d899-4805-a448-6019fee01211',N'2018-09-02 11:35:25')
INSERT INTO [dbo].[Posts] ([Id], [Title], [Body], [User_Id], [Time]) VALUES (9, N'Report the cheaters', N'Milk, yoghurt and cheese 每 try adding yogurt to breakfast cereal with milk, or using cottage cheese as a sandwich filling. Shavings of parmesan or cheddar can be used to top steamed vegetables or a salad. Use mostly reduced fat products.',N'5337eb88-a45e-4e22-b2bc-306dd8c7500f',N'2018-09-08 10:35:25')
INSERT INTO [dbo].[Posts] ([Id], [Title], [Body], [User_Id], [Time]) VALUES (10, N'I dont know what to say', N'The Australian Dietary Guidelines give advice on eating for health and wellbeing. They＊re called dietary guidelines because it＊s your usual diet that influences your health. Based on the latest scientific evidence, they describe the best approach to eating for a long and healthy life.',N'3be0b601-5487-4a8f-a3ea-8c6d7be87e10',N'2018-09-11 19:42:24')
INSERT INTO [dbo].[Posts] ([Id], [Title], [Body], [User_Id], [Time]) VALUES (11, N'Are you kidding me', N'There are many things that affect food choices, for example, personal preferences, cultural backgrounds or philosophical choices such as vegetarian dietary patterns. NHMRC has taken this into consideration in developing practical and realistic advice. Keeping the Australian Dietary Guidelines in mind will help your choice of healthy foods.',N'079db823-d899-4805-a448-6019fee01211',N'2018-09-19 21:56:47')
INSERT INTO [dbo].[Posts] ([Id], [Title], [Body], [User_Id], [Time]) VALUES (12, N'Get 5kg again signnnn!', N'Many of the health problems due to poor diet in Australia stem from excessive intake of foods that are high in energy, saturated fat, added sugars and/or added salt but relatively low in nutrients. These include fried and fatty take-away foods, baked products like pastries, cakes and biscuits, savoury snacks like chips, and sugar-sweetened drinks. If these foods are consumed regularly they can increase the risk of excessive weight gain and other diet-related conditions and diseases.',N'5337eb88-a45e-4e22-b2bc-306dd8c7500f',N'2018-09-20 20:45:42')
